import React from 'react';
import { Route, Switch } from 'react-router';
import { InventoryAddCard } from '../../../Cards';
import {

} from '../../../components';
import './styles.css';

const Buyer = () => {
	return (
		<div className='buyermarketplace-container'>
			<Switch>
				<div className='buyermarketplace-container-header'>
					<Route
						path='/buyer/marketplace'
						exact
						component={MarketPlaceDashboard}
					/>
					<Route
						path='/buyer/marketplace/market'
						exact
						component={MarketPlaceMarket}
					/>
					<Route
						path='/buyer/marketplace/inventory'
						exact
						component={MarketPlaceInventory}
					/>
					<Route
						path='/buyer/marketplace/fleet'
						exact
						component={MarketPlaceFleet}
					/>
					<Route
						path='/buyer/marketplace/inventorylist'
						exact
						component={MarketPlaceInventoryList}
					/>
					<Route
						path='/buyer/marketplace/transaction'
						exact
						component={MarketPlaceTransaction}
					/>
					<Route
						path='/buyer/marketplace/addcard'
						exact
						component={InventoryAddCard}
					/>
					<Route
						path='/buyer/marketplace/profile'
						exact
						component={ProfilePage}
					/>
					<Route
						path='/buyer/marketplace/fleetinfo'
						exact
						component={FleetInfo}
					/>
				</div>
			</Switch>
		</div>
	);
};

export default Buyer;
